(1, 'Jerusalem', 'data:image/jpeg;base64,', '\n    Jerusalem, Hebrew Yerushalayim, \n    Arabic Bayt al-Muqaddas or Al-Quds, \n    ancient city of the Middle East that since 1967 \n    has been wholly under the rule of the State of Israel.\n        ');
INSERT INTO `city` (`id`, `name`, `img`, `des`) VALUES
(2, 'Nablus', 'data:image/jpeg;base64,', '              \n    Nablus, Arabic Nābulus or Nāblus, Greek Neapolis,\n    Hebrew Shekhem,\n    city in the West Bank. \n    It lies in an enclosed fertile valley and is the market\n    centre of a natural oasis that is watered by numerous springs.\n        ');
INSERT INTO `city` (`id`, `name`, `img`, `des`) VALUES
(3, 'Ramallah', 'data:image/jpeg;base64,', '              \n    Ramallah, also spelled Rām Allāh,\n    town in the West Bank, \n    adjacent to the town of Al-Bīrah (east) and north of Jerusalem.\n    Administered as part of the British mandate of Palestine (1920–48),\n    Ramallah was part of the West Bank territory taken by Arab forces\n    in the first of the Arab-Israeli wars (1948–49) and subsequently\n    annexed by Jordan. After the Six-Day War of 1967, Ramallah was \n    under Israeli control as part of the occupied West Bank territory\n    until coming under the administration of the Palestinian Authority \n    (PA) in the wake of the 1993 Oslo Accords; it later became the centre \n    of PA administration in the West Bank. As an ancient settlement, \n    Ramallah has buildings incorporating masonry from the time of Herod the \n    Great (reigned 37–4 BCE), but no complete structure antedates \n    the Crusades of the 11th century CE.\n        ');
INSERT INTO `city` (`id`, `name`, `img`, `des`) VALUES
(4, 'Hebron', 'data:image/jpeg;base64,', '              \n    Hebron,\n    Arabic Al-Khalīl,\n    in full Al-Khalīl al-Raḥmān \n    (“The Beloved of [God] the Merciful” [a reference to Abraham]), \n    Hebrew Ḥevron, city in the West Bank, \n    situated in the southern Judaean Hills south-southwest of Jerusalem. \n    Located about 3,050 feet (930 metres) above sea level, \n    Hebron long benefited from its mountainous clime, \n    which encouraged the cultivation of fruit trees and vineyards.\n    In addition,\n    its location at a natural crossroads placed it along a historically desirable travel route. \n    In modern times, Hebron was administered as part of the British mandate of Palestine (1920–48);\n    after the first of the Arab-Israeli wars in 1948–49, it was in the territory annexed by Jordan (1950).\n    Following the Six-Day War of June 1967, it was part of the West Bank territory that \n    came under Israeli occupation. In the wake of an agreement reached in January 1997, \n    part of Hebron came under the administration of the Palestinian Authority (PA), \n    while part of the city remained under Israeli control.\n        ');

